import React, { useState } from 'react';
import '../styles/formStyles.css';

const PropertyInputForm = ({ propertyInput, handleInputChange, handlePredictPrice, predictedPrice }) => {
    const [errors, setErrors] = useState({});

    const handleSubmit = (e) => {
        e.preventDefault();
        const newErrors = {};

        if (propertyInput.Area <= 101) {
            newErrors.Area = "Wow, that's tiny! Please enter a larger area. Are you looking for a cozy studio apartment?";
        } else if (propertyInput.Area > 5000 && propertyInput.Area <= 7000) {
            newErrors.Area = "Wow, that's spacious! Are you searching for a large family home? Please enter a more typical house size if not.";
        } else if (propertyInput.Area > 7000 && propertyInput.Area <= 10000) {
            newErrors.Area = "That's enormous! Are you looking for a mansion? Please enter a smaller size for typical homes.";
        } else if (propertyInput.Area > 10000) {
            newErrors.Area = "That's gigantic! This tool is for residential properties only. Please enter a smaller size.";
        }

        if (propertyInput.Bedrooms === 0) {
            newErrors.Bedrooms = "No bedrooms? Please enter at least one bedroom. Are you looking for a studio apartment?";
        } else if (propertyInput.Bedrooms < 0) {
            newErrors.Bedrooms = "Negative bedrooms don't exist! Please enter a positive number of bedrooms.";
        } else if (propertyInput.Bedrooms > 8) {
            newErrors.Bedrooms = "Wow, that's a lot of bedrooms! This tool is for residential properties only. Please enter 8 or fewer bedrooms.";
        }

        if (propertyInput.Bathrooms === 0) {
            newErrors.Bathrooms = "A house without bathrooms? Please enter at least one bathroom. Every home needs a bathroom!";
        } else if (propertyInput.Bathrooms < 0) {
            newErrors.Bathrooms = "Have you ever seen a negative number of bathrooms? Please enter a valid number of bathrooms.";
        } else if (propertyInput.Bathrooms > 10) {
            newErrors.Bathrooms = "That's way too many bathrooms for a house! Please enter a valid number of bathrooms.";
        }

        if (propertyInput["Age of Property"] < 0) {
            newErrors["Age of Property"] = "Have you ever heard of a property with a negative age? Please enter a valid, positive age for the property.";
        } else if (propertyInput["Age of Property"] >= 100) {
            newErrors["Age of Property"] = "Wow, that's ancient! Are you searching for a historic home? Please enter a lower age for more typical properties.";
        }

        if (!propertyInput.Location) {
            newErrors.Location = "We need to know where it is! Please enter a location for the property.";
        }

        setErrors(newErrors);

        if (Object.keys(newErrors).length === 0) {
            handlePredictPrice();
        }
    };


    return (
        <div className="form-container">
            <form className="form" onSubmit={handleSubmit}>
                <div className="input-group">
                    <label>Area:</label>
                    <input 
                        type="number" 
                        name="Area" 
                        value={propertyInput.Area} 
                        onChange={handleInputChange} 
                        required 
                    />
                    {errors.Area && <div className="error">{errors.Area}</div>}
                </div>
                <div className="input-group">
                    <label>Bedrooms:</label>
                    <input 
                        type="number" 
                        name="Bedrooms" 
                        value={propertyInput.Bedrooms} 
                        onChange={handleInputChange} 
                        required 
                    />
                    {errors.Bedrooms && <div className="error">{errors.Bedrooms}</div>}
                </div>
                <div className="input-group">
                    <label>Bathrooms:</label>
                    <input 
                        type="number" 
                        name="Bathrooms" 
                        value={propertyInput.Bathrooms} 
                        onChange={handleInputChange} 
                        required 
                    />
                    {errors.Bathrooms && <div className="error">{errors.Bathrooms}</div>}
                </div>
                <div className="input-group">
                    <label>Location:</label>
                    <div className="radio-input">
                        {['Downtown', 'Suburban', 'Rural'].map((location) => (
                            <label key={location}>
                                <input 
                                    type="radio" 
                                    id={location} 
                                    name="Location" 
                                    value={location} 
                                    checked={propertyInput.Location === location}
                                    onChange={handleInputChange}
                                    required
                                />
                                {location}
                            </label>
                        ))}
                        <span className="selection"></span>
                    </div>
                </div>
                <div className="input-group">
                    <label>Age of Property:</label>
                    <input 
                        type="number" 
                        name="Age of Property" 
                        value={propertyInput["Age of Property"]} 
                        onChange={handleInputChange} 
                        required 
                    />
                    {errors['Age of Property'] && <div className="error">{errors['Age of Property']}</div>}
                </div>
                <button className="btn-12" type="submit">
                    <span>Predict Price</span>
                </button>
            </form>

            {predictedPrice !== null && (
                <div className="form-container-predicted-price">
                    <h3 className="title">Predicted Price: ${predictedPrice.toLocaleString()}</h3>
                </div>
            )}
        </div>
    );
};

export default PropertyInputForm;
